import { memo, useEffect } from "react";

function List({fruits}){
    use
    return (
        <ul>
            {
                Object.values(fruits).length > 0 &&
                    Object.values(fruits).map((fruit,key)=>{
                        return (
                            <li key={key}>{fruit.name}</li>
                        )
                    })
            }
        </ul>

    )
}

export default memo(List);
